requests.preRequestScript:
export {};
const response = await hopp.fetch('https://echo.hoppscotch.io')
console.log('Response headers object:', typeof response.headers)
console.log('Response headers.entries:', typeof response.headers.entries)

try {
  const entriesResult = response.headers.entries()
  console.log('entries() returned:', typeof entriesResult)
  console.log('entriesResult is array:', Array.isArray(entriesResult))

  // Try direct iteration
  for (const entry of entriesResult) {
    console.log('Entry:', entry)
    break
  }

  hopp.env.active.set('iterator_test', 'success')
} catch (error) {
  console.error('Error:', error)
  hopp.env.active.set('iterator_test', String(error))
}

requests.testScript:
export {};
hopp.test('Iterator works', () => {
  const result = hopp.env.active.get('iterator_test')
  console.log('Test result:', result)
  hopp.expect(result).toBe('success')
})
